import React from "react";

const Card = ({ data, state }) => {
  console.log(data);

  const readMore = (url) => {
    window.open(url);
  };

  return (
    <div className={`cardContainer ${state}`}>
      {data.map((curItem, index) => {
        if (!curItem.urlToImage) {
          return null;
        } else {
          return (
            <div className={`card ${state}`} key={index}>
              <img src={curItem.urlToImage} alt="news" />
              <div className="content">
                <a className="title" onClick={() => window.open(curItem.url)}>
                  {curItem.title}
                </a>
                <p>{curItem.description}</p>
                <button onClick={() => window.open(curItem.url)}>
                  Read More
                </button>
              </div>
            </div>
          );
        }
      })}
    </div>
  );
};

export default Card;
